import React from 'react';
import styled from "styled-components";

export interface PokemonBoxProps {
    //background color (set default as transparent, being = '')
    pokemonName?: string;
    pokemonNumber?: string;
    pokemonS3Url?: string;
}

const PokemonBox: React.FC<PokemonBoxProps> = ( {pokemonName = '', pokemonNumber = '', pokemonS3Url = ''}) =>
( 
<PokemonBoxCtn>
    <PokemonCard>
        Pokemon name: {pokemonName}
        Pokemon number: {pokemonNumber}
        <img src={'https://pocket-dex-bucket.s3.us-east-2.amazonaws.com/' + {pokemonS3Url} + '.png'}></img>
    </PokemonCard>
</PokemonBoxCtn>
);
export default PokemonBox;

// Styled Background component for the background of each screen to fill up, also takes in background color prop
const PokemonBoxCtn = styled.button`
    width: 100px;
    height: 100px;
    background-color: blue;
    margin: 10px;
    display:flex;
    box-shadow: inset 0px 0px 0px 5px #363636;
`;

const PokemonCard = styled.div`
    width: 100%;
    height: 100%;
    display: flex;
    align-items:center;
    background-color:green;
`;
